import React, { Component } from 'react';
import { render } from 'react-dom';
import Select from 'react-select';

const options = [
  { value: 'a', label: 'Financial' },
  { value: 'b', label: 'Operational' },
  { value: 'c', label: 'Management' },
];


class App extends React.Component {
  constructor() {
    super()
    this.state= { expanded : false}

  }
  showCheckboxes() {
      var checkboxes = document.getElementById("checkboxes");
      if (!this.state.expanded) {
          checkboxes.style.display = "block";
          this.state.expanded = true;
      } else {
          checkboxes.style.display = "none";
          this.state.expanded = false;
      }
  }
  render() {
    return (
      <form>
        <div class="multiselect">
            <div class="selectBox" onclick="showCheckboxes()">
                <select>
                    <option>Select an option</option>
                     <options for="one"><input type="checkbox" id="one"/>First checkbox</options>
                </select>
                <div class="overSelect"></div>
            </div>
            <div id="checkboxes">
            <select>
                <options for="one"><input type="checkbox" id="one"/>First checkbox</options>
                <options for="two"><input type="checkbox" id="two"/>Second checkbox </options>
                <options for="three"><input type="checkbox" id="three"/>Third checkbox</options>
                </select>
            </div>
        </div>
      </form>
    )
  }
}
export default App;
